window.bookSummaryJSON = "<p><b>Nothing is as it seems. It never was.</b></p> <p>With darkness spreading across the fae isles, the reluctant raven queen seeks the aid of Calista, the storyteller, and unwittingly falls into a dark tale of twisted fates. To save Ari from being lost in a fae sleep, Saga will reach into the past and uncover deadly secrets left behind by her brother, the last fate king.</p> <p>Both Saga and Ari must unravel the lies of their world if they are to stand a chance at defeating the fiercest enemy yet. But when their actions lead to the destruction of every kingdom, Saga and Ari must make a choice: risk the lives of those they love or burn the world to save each other.</p> <p>Return to the epic, passionate love story of Ari and Saga in the spicy new adult fantasy romance where fae Vikings come to life with heart-stopping battles, dangerous magic, and tantalizing romance.</p>"; 
